static PointerRNA Node_inputs_get(CollectionPropertyIterator *iter)
{
	return rna_pointer_inherit_refine(&iter->parent, &RNA_NodeSocket, rna_iterator_listbase_get(iter));
}

void Node_inputs_begin(CollectionPropertyIterator *iter, PointerRNA *ptr)
{
	bNode *data = (bNode *)(ptr->data);

	memset(iter, 0, sizeof(*iter));
	iter->parent = *ptr;
	iter->prop = (PropertyRNA *)&rna_Node_inputs;

	rna_iterator_listbase_begin(iter, &data->inputs, NULL);

	if (iter->valid)
		iter->ptr = Node_inputs_get(iter);
}

void Node_inputs_next(CollectionPropertyIterator *iter)
{
	rna_iterator_listbase_next(iter);

	if (iter->valid)
		iter->ptr = Node_inputs_get(iter);
}

void Node_inputs_end(CollectionPropertyIterator *iter)
{
	rna_iterator_listbase_end(iter);
}

int Node_inputs_lookup_int(PointerRNA *ptr, int index, PointerRNA *r_ptr)
{
	int found = 0;
	CollectionPropertyIterator iter;

	Node_inputs_begin(&iter, ptr);

	if (iter.valid) {
		ListBaseIterator *internal = &iter.internal.listbase;
		if (internal->skip) {
			while (index-- > 0 && iter.valid) {
				rna_iterator_listbase_next(&iter);
			}
			found = (index == -1 && iter.valid);
		}
		else {
			while (index-- > 0 && internal->link)
				internal->link = internal->link->next;
			found = (index == -1 && internal->link);
		}
		if (found) *r_ptr = Node_inputs_get(&iter);
	}

	Node_inputs_end(&iter);

	return found;
}

int Node_inputs_lookup_string(PointerRNA *ptr, const char *key, PointerRNA *r_ptr)
{
	extern int NodeSocket_name_length(PointerRNA *);
	extern void NodeSocket_name_get(PointerRNA *, char *);

	bool found = false;
	CollectionPropertyIterator iter;
	char namebuf[1024];
	char *name;

	Node_inputs_begin(&iter, ptr);

	while (iter.valid) {
		if (iter.ptr.data) {
			int namelen = NodeSocket_name_length(&iter.ptr);
			if (namelen < 1024) {
				NodeSocket_name_get(&iter.ptr, namebuf);
				if (strcmp(namebuf, key) == 0) {
					found = true;
					*r_ptr = iter.ptr;
					break;
				}
			}
			else {
				name = MEM_mallocN(namelen+1, "name string");
				NodeSocket_name_get(&iter.ptr, name);
				if (strcmp(name, key) == 0) {
					MEM_freeN(name);

					found = true;
					*r_ptr = iter.ptr;
					break;
				}
				else {
					MEM_freeN(name);
				}
			}
		}
		Node_inputs_next(&iter);
	}
	Node_inputs_end(&iter);

	return found;
}

