{
	rna_iterator_listbase_end(iter);
}

int NodeTree_inputs_lookup_int(PointerRNA *ptr, int index, PointerRNA *r_ptr)
{
	int found = 0;
	CollectionPropertyIterator iter;

	NodeTree_inputs_begin(&iter, ptr);

	if (iter.valid) {
		ListBaseIterator *internal = &iter.internal.listbase;
		if (internal->skip) {
			while (index-- > 0 && iter.valid) {
				rna_iterator_listbase_next(&iter);
			}
			found = (index == -1 && iter.valid);
		}
		else {
			while (index-- > 0 && internal->link)
				internal->link = internal->link->next;
			found = (index == -1 && internal->link);
		}
		if (found) *r_ptr = NodeTree_inputs_get(&iter);
	}

	NodeTree_inputs_end(&iter);

	return found;
}

int NodeTree_inputs_lookup_string(PointerRNA *ptr, const char *key, PointerRNA *r_ptr)
{
	extern int NodeSocketInterface_name_length(PointerRNA *);
	extern void NodeSocketInterface_name_get(PointerRNA *, char *);

	bool found = false;
	CollectionPropertyIterator iter;
	char namebuf[1024];
	char *name;

	NodeTree_inputs_begin(&iter, ptr);

	while (iter.valid) {
		if (iter.ptr.data) {
			int namelen = NodeSocketInterface_name_length(&iter.ptr);
			if (namelen < 1024) {
				NodeSocketInterface_name_get(&iter.ptr, namebuf);
				if (strcmp(namebuf, key) == 0) {
					found = true;
					*r_ptr = iter.ptr;
					break;
				}
			}
			else {
				name = MEM_mallocN(namelen+1, "name string");
				NodeSocketInterface_name_get(&iter.ptr, name);
				if (strcmp(name, key) == 0) {
					MEM_freeN(name);

					found = true;
					*r_ptr = iter.ptr;
					break;
				}
				else {
					MEM_freeN(name);
				}
			}
		}
		NodeTree_inputs_next(&iter);
	}
	NodeTree_inputs_end(&iter);

	return found;
}

