void NodeInputs_new_call(bContext *C, ReportList *reports, PointerRNA *_ptr, ParameterList *_parms)
{
	struct ID *_selfid;
	struct bNode *_self;
	const char * type;
	const char * name;
	const char * identifier;
	struct bNodeSocket *socket;
	char *_data, *_retdata;
	
	_selfid = (struct ID *)_ptr->id.data;
	_self = (struct bNode *)_ptr->data;
	_data = (char *)_parms->data;
	type = *((const char * *)_data);
#if defined(SPEC_ILP32)
	_data += 4;
#else
	_data += 8;
#endif
	name = *((const char * *)_data);
#if defined(SPEC_ILP32)
	_data += 4;
#else
	_data += 8;
#endif
	identifier = *((const char * *)_data);
#if defined(SPEC_ILP32)
	_data += 4;
#else
	_data += 8;
#endif
	_retdata = _data;
	
	socket = rna_Node_inputs_new(_selfid, _self, reports, type, name, identifier);
	*((struct bNodeSocket **)_retdata) = socket;
}

